package fes.aragon.modelos;

public class Modelos {
	private String convertir;
	private String evaluar;
	private String palindromo;
	private String encriptar;
	public Modelos() {
		// TODO Auto-generated constructor stub
	}

	public final String getConvertir() {
		
		return convertir;
	}

	public void setConvertir(String convertir) {
		this.convertir = convertir;
	}

	public final String getEvaluar() {
		return evaluar;
	}

	public final void setEvaluar(String evaluar) {
		this.evaluar = evaluar;
	}

	public final String getPalindromo() {
		return palindromo;
	}

	public final String getEncriptar() {
		return encriptar;
	}

	public final void setPalindromo(String palindromo) {
		this.palindromo = palindromo;
	}

	public final void setEncriptar(String encriptar) {
		this.encriptar = encriptar;
	}

}
